def solve(arr):
    max_num = max(arr)
    min_num = min(arr)
    range_num = max_num - min_num + 1
    count_arr = [0] * range_num
    output_arr = [0] * len(arr)

    for i in range(len(arr)):
        count_arr[arr[i] - min_num] += 1

    for i in range(1, len(count_arr)):
        count_arr[i] += count_arr[i-1]

    for i in range(len(arr)):
        output_arr[count_arr[arr[i] - min_num] - 1] = arr[i]
        count_arr[arr[i] - min_num] -= 1

    for i in range(len(arr)):
        arr[i] = output_arr[i]

    return arr

def solve(arr):
    count = [0] * (max(arr) + 1)
    result = [0] * len(arr)

    for num in arr:
        count[num] += 1

    for i in range(1, len(count)):
        count[i] += count[i-1]

    for num in arr:
        result[count[num]-1] = num
        count[num] -= 1

    return result

def solve(arr):
    count = [0] * (max(arr) + 1)

    for num in arr:
        count[num] += 1

    sorted_arr = []
    for i in range(len(count)):
        for j in range(count[i]):
            sorted_arr.append(i)

    return sorted_arr

def solve(arr): 
    count = [0] * (max(arr) + 1) 
    output = [0] * len(arr) 

    for i in range(len(arr)): 
        count[arr[i]] += 1

    for i in range(1, len(count)): 
        count[i] += count[i-1] 

    for i in range(len(arr)-1, -1, -1): 
        output[count[arr[i]]-1] = arr[i] 
        count[arr[i]] -= 1

    for i in range(len(arr)): 
        arr[i] = output[i] 

    return arr
